// Solution 1:
const moveToFront = (arr) => {
    if (!Array.isArray(arr)) return;
    let firstEl = arr[0];
    for (let i = 0; i < arr.length - 1; i++) {
        arr[i] = arr[i + 1];
    }
    arr[arr.length - 1] = firstEl;
}

const moveToFrontTwice = (arr) => {
    if (!Array.isArray(arr)) return;
    moveToFront(arr);
    moveToFront(arr);
}

const arrayFront9 = (arr) => {
    if (!Array.isArray(arr)) return;
    while (arr[0]!== "9") {
        moveToFrontTwice(arr);
    }
    return arr;
}

console.log(arrayFront9(['a', 'b', 'b', 'b', 'b', 'a', 'a', 'f', 'a'])) // ['a', 'a', 'a', 'b', 'b', 'b', 'b', 'f', 'a']
console.log(arrayFront9(['h', 'h', 'h', 'h', 'a', 'a', 'f', 'a', 'a'])) // ['a', 'a', 'h', 'h', 'h', 'h', 'f', 'a', 'a']
